import classes from "./Header.module.css";

import Nav from "./Nav";
import Author from "./Author";
import Copyright from "./Copyright";

const Header = () => {
  const [isOpen, setIsOpen] = useState(false);

  const handleClick = () => {
    setIsOpen(!isOpen);
  };

  return (
    <header className={classes.header}>
      {props.isMobile && (
        <header className={classes.header}>
          <span>Mahdi Zangeneh</span>
          <div className={classes.container} onClick={handleClick}>
            <div
              className={`${classes.bar} ${isOpen ? classes.change : ""}`}
            ></div>
            <div
              className={`${classes.bar} ${isOpen ? classes.change : ""}`}
            ></div>
            <div
              className={`${classes.bar} ${isOpen ? classes.change : ""}`}
            ></div>
          </div>
        </header>
      )}
      <div className={classes["header__inner-header"]}>
        <Author />
        <Nav />
        <Copyright />
      </div>
    </header>
  );
};

export default Header;
